$(document).ready(function() {
    $(".skip-content").on("focusin", function() {
        $(this).toggleClass("active");
    }).on("focusout", function() {
        $(this).toggleClass("active");
    }), $(".navbar-toggle").on("click", function(t) {
        t.preventDefault(), $(this).toggleClass("active"), $(".menu").toggleClass("active");
    }), $(".menu-item-has-children > a").on("click", function(t) {
        t.preventDefault(), $(this).parent().find(".sub-menu").toggleClass("active"), $(this).parent().toggleClass("active");
    }), $(".slide-container").slick({
        autoplay: !0,
        autoplaySpeed: 3e3,
        speed: 800,
        adaptiveHeight: !0,
        arrows: !0,
        appendArrows: $(".slide-arrows"),
        prevArrow: '<button><i class="material-icons md-48">keyboard_arrow_left</i></button>',
        nextArrow: '<button><i class="material-icons md-48">keyboard_arrow_right</i></button>',
        dots: !0,
        appendDots: $(".slide-dots")
    });
});